} impl traits::Storage for Storage { fn set(&mut self, key: Vec<u8>, value: Vec<u8>) -> Option<Vec<u8>> { self.cache.insert(key, value).ok()?.map(|v| v.to_vec()) } fn remove(&mut self, key: &[u8]) -> Option<Vec<u8>> { self.cache.remove(key).ok()?.map(|v| v.to_vec()) } fn get(&self, key: &[u8]) -> Option<Vec<u8>> { self.cache.get(key).ok()?.map(|v| v.to_vec()) }
